ph -->\n\n<!-- wp:paragraph -->\n<p>ASUS Prime Z390-A - Tarjeta Madre LGA1151</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Diseñado para procesadores Intel Core de novena y octava generación para maximizar la conectividad y la velocidad con M.2, SB 3.1 Gen2 y ASUS Optimum II para una mejor estabilidad del overclocking de DRAM Optimización de 5 vías renovada que tiene la inteligencia de overclock de una CPU basada en predicción inteligente y telemetría térmica 5X Protección III de nivel de hardware con núcleo de ranura segura, protección LAN, protección contra sobretensión, proporciona longevidad, fiabilidad. FanXpert 4 ofrece un control avanzado del ventilador para la refrigeración dinámica del sistema.Las ranuras PCIe fortificadas de Safe Slot Core pendientes de patente evitan daños causados por GPU pesadas. Audio para videojuegos HD de 8 canales con Realtek ALC887 de alta definición</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$924.000</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":39,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/71OmavzkW8L._AC_SL1408_-1024x942.jpg\" alt=\"\" class=\"wp-image-39\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>MSI Z390-A PRO LGA1151 (Intel 8ª y 9ª generación)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Soporta 9ª generación i9-9900K, i7-9700K, i5-9600K y 8ª generación Intel Core / Pentium Gold / Celeron procesadores para LGA 1151 Socket Soporta memoria DDR4 de doble canal, hasta 4400 (oc) MHz Turbo M.2: PCI-E gen3 x4 interface maximiza el endimiento para NVME SSDS Core Boost, conector de alimentación de CPU de 8 + 4 pines, DDR4 Boost<br>Construido para un funcionamiento fiable Sistema operativo: compatible con Windows 10 de 64 bits Intel Turbo USB 3.1 Gen2: alimentado por el controlador Intel USB 3.1 Gen2, el turbo USB garantiza una conexión ininterrumpida con más estabilidad y velocidades USB más rápidas</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$896.000</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":44,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/81YOcB0sHbL._AC_SL1500_-1024x702.jpg\" alt=\"\" class=\"wp-image-44\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>MSI MPG Z490 Gaming Plus Placa base para juegos</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Soporta procesadores Intel Core de 10ª generación / Pentium Gold / Celeron para LGA 1200 Socket Soporta memoria DDR4 de doble canal de hasta 128 GB (4800 MHz). Twin Turbo M.2 con M.2 Shield Frozr ofrece velocidades de transferencia de hasta 32 GB/s para SSD ultrarrápidos. La tecnología Core Boost combina diseños de circuito de potencia optimizados, conectores de alimentación de doble CPU y un diseño de alimentación digital que permite una entrega de corriente precisa y constante a la CPU. LAN de 2.5 G más Gigabit LAN con Wi-Fi 6 (802.11ax). Blindaje I/O preinstalado para mayor comodidad y protección contra descarga electrostática.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$897.000</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":47,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/91D8uWFdGDL._AC_SL1500_-1-1024x726.jpg\" alt=\"\" class=\"wp-image-47\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Yongxinsheng DDR3 (8 GBx2)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Prueba estricta: compatibilidad probada en todas las marcas populares de placas madre. Nota: comprueba las especificaciones de tu dispositivo antes de comprar. Como el modelo RAM, la ranura RAM y la memoria máxima de tu ordenado</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Amplio rango de voltaje: 1,425 V ~ 1,575 V rango de voltaje puede funcionar normalmente, prevenir eficazmente la fluctuación de voltaje/fuente de alimentación del ordenador, afectando la vida útil de la RAM y la eficiencia de trabajo. Tiempos: CL-11-11-11-28</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$145.789</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":50,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/1.jpg\" alt=\"\" class=\"wp-image-50\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>TEAMGROUP T-Force módulo para memoria RAM</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Hecho a medida para AMD (procesador Ryzen 3000 de última generación y placa base X570 probado bajo compatibilidad y estabilidad totales). Diseño de armadura para una protección perfecta; disipador de calor de aleación de aluminio con alto rendimiento; adhesivo conductor térmico de alta calidad. IC de alta calidad; compatibilidad con perfiles OC Ahorro de energía con voltaje de rabajo ultra bajo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$234.789</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":51,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/2-1024x687.jpg\" alt=\"\" class=\"wp-image-51\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Corsair Vengeance RGB PRO 16GB (2x8GB)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Iluminación RGB dinámica multizona Software de próxima generación PCB de rendimiento personalizado Memoria bien blindada. Ancho de banda máximo y tiempos de respuesta reducidos. Voltaje SPD: 1,2 V Compatibilidad: Intel 100 Series, Intel 200 Series, Intel 300 Series, Intel X299, AMD 300 Series, AMD 400 Series, AMD X570</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$123.739</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":52,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/3-1024x399.jpg\" alt=\"\" class=\"wp-image-52\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Corsair Vengeance LPX 16GB (2x8GB)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Vengeance LPX memoria es diseñado para overclocking de alto rendimiento de de calor, fabricado en aluminio puro para una disipación térmica más rápida, y la eight-layer PCB ayuda a gestionar calor y proporciona una excelente capacidad de overclocking Disipador de calor de aluminio de puro para una disipación térmica más rápida y temperatura.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$342.789</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":53,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/4.jpg\" alt=\"\" class=\"wp-image-53\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Para hacer frente al cambio de proceso de fabricación de la memoria, TEAMGROUP cambiará la forma de los efectos de iluminación RGB en la memoria de juegos DELTA RGB a partir de 2021. Esta no es una iluminación defectuosa o defectuosa, y no afecta el funcionamiento de los efectos de iluminación y control de software. Iluminación ultra gran angular de 120 ° de fotograma completo con efecto de iluminación Force Flow RGB incorporado, compatible con sincronización de software</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>TEAMGROUP T-Force Delta RGB DDR4</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$143.999</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":54,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/5.jpg\" alt=\"\" class=\"wp-image-54\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Corsair Vengeance - DDR4 DRAM Memoria</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Diseñado para overclocking de alto rendimiento igualmente para gran aspecto Rendimiento y compatibilidad Diseño de disipador de calor de perfil bajo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$211.732</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":55,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/6-1024x704.jpg\" alt=\"\" class=\"wp-image-55\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tarjeta gráfica MSI GAMING GeForce GTX 1050 Ti 4GB</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>GDRR5 128-bit HDCP Support DirectX 12 TORX 2.0 tarjeta de gráficos (GTX 1050 TI GAMING X 4G)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$185.789</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":56,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/1-1-1024x773.jpg\" alt=\"\" class=\"wp-image-56\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>MSI Gaming GeForce GTX 1660 192-Bit HDMI/DP 6GB</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Chipset: NVIDIA GeForce GTX 1660, Reloj de impulso: 1830 MHz, Interfaz de memoria: 192 bits, Memoria de vídeo: 6 GB GDDR5. Consumo de energía: 120 W. PSU recomendado: 450 W, Salida: DisplayPort x 3 (V1; 4)/HDMI 2; 0B x 1</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$745.755</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":57,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/2-1-1024x760.jpg\" alt=\"\" class=\"wp-image-57\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tarjeta gráfica ASUS TUF Gaming NVIDIA GeForce RTX 3060 OC Edition (PCIe 4.0, 12GB</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>NVIDIA Ampere Streaming multiprocesadores: los bloques de construcción para la GPU más rápida y eficiente del mundo, el nuevo Ampere SM ofrece 2 veces el rendimiento FP32 y mejora la eficiencia energética.<br>Núcleos RT de segunda generación: experimenta 2 veces el rendimiento de los núcleos RT de 1ª generación, además de RT y sombreado concurrentes para un nuevo nivel de rendimiento de trazado de rayos.<br>Núcleos tensor de 3ª generación: obtén hasta 2 veces el rendimiento con esencia estructural y algoritmos de IA avanzados como DLSS. Ahora con soporte para una resolución de hasta 8 K, estos núcleos ofrecen un aumento masivo en el rendimiento del juego y capacidades de AI.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$745.889</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":58,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/3-1-1017x1024.jpg\" alt=\"\" class=\"wp-image-58\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tarjeta gráfica ASUS TUF Gaming NVIDIA GeForce GTX 1650 OC Edition (PCIe 3.0, memoria GDDR6 de 4GB, HDMI</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>El ASUS TUF Gaming GeForce GTX 1650 está construido con el rendimiento gráfico innovador de la galardonada arquitectura NVIDIA Turing para sobrecargar tus juegos favoritos. GDDR6 ultrarrápido con más de un 50% más de ancho de banda de memoria para juegos de alta velocidad. Auto Extreme Manufacturing utiliza automatización para mejorar la fiabilidad. Las pruebas de compatibilidad TUF garantizan que los componentes TUF Gaming y TUF Gaming Aliance trabajen perfectamente juntos. La placa trasera protectora asegura los componentes durante el transporte y la instalación.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$945.709</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":59,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/4-1-1017x1024.jpg\" alt=\"\" class=\"wp-image-59\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>ASUS PH-GTX1050TI-4G GeForce GTX 1050 Ti 4GB GDDR5</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Velocidades de reloj de 7008MHz, Interfaz PCI Express 3.0, Puertos: 1 DVI-D, 1 HDMI 2.0, 1 DisplayPort. Chipset: NVIDIA GPU Procesador: GeForce GTX 1050 Ti</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>$745.788</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":60,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/Trabajo/wp-content/uploads/2021/04/5-1-1024x973.jpg\" alt=\"\" class=\"wp-image-60\"/></figure>\n<!-- /wp:image -->', 'TARGETAS MADRE', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2021-04-05 21:18:59', '2021-04-06 02:18:59', '', 12, 'http://localhost/Trabajo/?p=61', 0, 'revision', '', 0),
